import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { DocumentService } from '../../core/services/document.service';

@Component({
  selector: 'app-document-list',
  templateUrl: './document-list.component.html',
  styleUrls: ['./document-list.component.css']
})
export class DocumentListComponent implements OnInit {

  documents: any[] = [];
  isLoading = false;
  searchText = '';
  errorMessage = '';

  constructor(
    private documentService: DocumentService,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.loadDocuments();
  }

  loadDocuments(): void {
    this.isLoading = true;
    this.errorMessage = '';
    this.documentService.getDocuments().subscribe({
      next: (res) => {
        this.documents = res;
        this.isLoading = false;
      },
      error: (error) => {
        this.isLoading = false;
        console.error('Error loading documents:', error);
        
        // If 401 Unauthorized, redirect to login
        if (error.status === 401) {
          this.errorMessage = 'Session expired. Please login again.';
          localStorage.removeItem('token');
          localStorage.removeItem('user');
          setTimeout(() => {
            this.router.navigate(['/auth/login']);
          }, 1500);
        } else {
          this.errorMessage = error.error?.message || 'Failed to load documents';
        }
      }
    });
  }

  canEdit(doc: any): boolean {
    return (
      doc.uploadedBy?._id === this.getUserId() ||
      doc.permissions?.some(
        (p: any) => p.userId === this.getUserId() && p.canEdit
      )
    );
  }

  getUserId(): string | null {
    const user = localStorage.getItem('user');
    return user ? JSON.parse(user)._id : null;
  }
}
<div class="p-6">

  <h2 class="text-2xl font-bold mb-4">Documents</h2>

  <!-- Search -->
  <input
    type="text"
    [(ngModel)]="searchText"
    placeholder="Search documents..."
    class="border rounded px-3 py-2 w-full mb-4"
  />

  <!-- Loader -->
  <app-loader *ngIf="isLoading"></app-loader>

  <!-- Document List -->
  <div *ngIf="!isLoading && documents.length > 0" class="space-y-3">

    <div
      *ngFor="let doc of documents"
      class="border rounded p-4 bg-white shadow-sm flex justify-between items-center"
    >
      <div>
        <h3
          class="font-semibold"
        >{{ doc.title }}</h3>

        <p class="text-sm text-gray-500">
          Version {{ doc.currentVersion }} · {{ doc.fileType }}
        </p>

        <div class="flex flex-wrap gap-2 mt-2">
          <span
            *ngFor="let tag of doc.tags"
            class="text-xs bg-blue-100 text-blue-700 px-2 py-1 rounded"
          >
            {{ tag }}
          </span>
        </div>
      </div>

      <!-- Actions -->
      <div class="flex gap-2">
        <a
          [href]="doc.fileUrl"
          target="_blank"
          class="px-3 py-1 bg-gray-200 rounded text-sm"
        >
          View
        </a>

        <button
          *ngIf="canEdit(doc)"
          class="px-3 py-1 bg-blue-600 text-white rounded text-sm"
        >
          Edit
        </button>
      </div>
    </div>

  </div>

  <!-- Empty State -->
  <div *ngIf="!isLoading && documents.length === 0" class="text-gray-500 mt-6">
    No documents found.
  </div>

</div>
